import React from 'react';
import Menu from '../../components/Menu';
import DadosCadastraisUsuario from '../../components/DadosCadastraisUsuario';
import Titulo from '../../components/Titulo';
import './index.css';
import { Container,Breadcrumb} from 'react-bootstrap';
const {Item} = Breadcrumb;

function Home() {
    return (
        <div>
            <Menu />
            <Breadcrumb>
                <Item active="/">Dados Pessoais</Item>
            </Breadcrumb>
            <Container>
                <Titulo name='Dados Cadastrais' />
                <DadosCadastraisUsuario cod='1'/>
            </Container>

        </div>

    );
}

export default Home;
